import { useEffect, useState } from 'react';
import './App.css';
import { getAllCars } from './services/carService';
import { Link, Switch, Route, Routes } from 'react-router-dom';
import AppCars from './components/appCars/AppCars';

function App() {

  const [cars, setCars] = useState([]);

  useEffect(() => {
    const getCars = async () => {
      const {data} = await getAllCars()

      setCars(data);
    }

    getCars()
  }, [])

  console.log("allCars: ", cars);


  return (
    <>
      <nav>
        <ul>
          <li>
            <Link to={"/"}>Cars Application</Link>
          </li>
          <li>
            <Link to={"/cars"}>All Cars</Link>
          </li>
        </ul>
      </nav>
      <div>
        <Routes>
          <Route path="/cars" element={<AppCars />} />
        </Routes>
      </div>
    </>
  );
}

export default App;
